command.metadata:
{
  "newAggregate": false,
  "schema": {
    "topicId": "/App/Topic:topicId",
    "attendeeId": "string|format:uuid"
  },
  "uiSchema": {
    "topicId": {
      "ui:title": "Choose a topic",
      "ui:widget": "DataSelect",
      "ui:options": {
        "data": "/App/TopicList",
        "value": "data.topicId",
        "text": "data.name"
      }
    },
    "attendeeId": {
      "ui:widget": "hidden"
    },
    "ui:button": {
      "icon": "vote",
      "hidden": "user.userId != page|data('/App/Attendee', {userId: ''}).userId"
    },
    "ui:description": "You'll receive a notification, if voting limit is reached"
  }
}

aggregate.metadata:
{
  "rules": [
    {
      "rule": "always",
      "then": {
        "assign": {
          "variable": "isAlreadyRegistered",
          "value": "false"
        }
      }
    },
    {
      "rule": "always",
      "then": {
        "forEach": {
          "variable": "attendeeList",
          "then": {
            "execute": {
              "rules": [
                {
                  "rule": "condition",
                  "if": "item.attendeeId == meta.user.userId",
                  "then": {
                    "assign": {
                      "variable": "isAlreadyRegistered",
                      "value": "true"
                    }
                  }
                }
              ]
            }
          }
        }
      }
    },
    {
      "rule": "condition",
      "if": "isAlreadyRegistered",
      "then": {
        "throw": {
          "error": "'You have already registered for the Open Space'"
        }
      },
      "stop": true
    },
    {
      "rule": "always",
      "then": {
        "record": {
          "event": "Attendee Registered",
          "mapping": {
            "$merge": "command",
            "userId": "meta.user.userId"
          }
        }
      }
    }
  ]
}

